import React from 'react';
//Components
import Header from './components/Header'
import Footer from './components/Footer'

//Style
import './App.css';


function App() {
  return (
    <div className="App">
    <Header/>
      <h1>Welcome</h1>
    <Footer/>
    </div>
  );
}

export default App;
